-- Создание таблиц
DROP TABLE IF EXISTS experiments, cultures, predecessors, conditions CASCADE;
CREATE TABLE cultures (id SERIAL PRIMARY KEY, name TEXT UNIQUE);
CREATE TABLE predecessors (id SERIAL PRIMARY KEY, name TEXT UNIQUE);
CREATE TABLE conditions (id SERIAL PRIMARY KEY, name TEXT UNIQUE);
CREATE TABLE experiments (
        id SERIAL PRIMARY KEY,
        year INT,
        field INT,
        culture_id INT REFERENCES cultures(id),
        predecessor_id INT REFERENCES predecessors(id),
        condition_id INT REFERENCES conditions(id),
        yield NUMERIC(5,2)
    );

